import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import API from '../utils/api';

const DashboardPage = () => {
  const [organisations, setOrganisations] = useState([]);
  const [searchResults, setSearchResults] = useState([]);
  const [requestedOrgs, setRequestedOrgs] = useState([]);
  const [selectedOrg, setSelectedOrg] = useState('');
  const [searchQuery, setSearchQuery] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchOrganisations = async () => {
      try {
        const { data } = await API.get('/users/me', {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        });

        setOrganisations(data.organisations || []);
        setRequestedOrgs(data.accessRequests || []);
      } catch (err) {
        console.error(err);
      }
    };

    fetchOrganisations();
  }, []);

  const handleSearch = async () => {
    try {
      const { data } = await API.get(`/organisations/search?query=${searchQuery}`, {
        headers: {
          Authorization: `Bearer ${localStorage.getItem('token')}`,
        },
      });
      setSearchResults(data);
    } catch (err) {
      console.error(err);
    }
  };

  const handleRequestAccess = async (orgId) => {
    try {
      await API.post(
        '/users/request-access',
        { orgId, userId: JSON.parse(localStorage.getItem('user'))._id },
        {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        }
      );
      alert('Access request sent');
      setSearchResults((prevResults) =>
        prevResults.map((org) =>
          org._id === orgId ? { ...org, requested: true } : org
        )
      );
    } catch (err) {
      console.error(err);
    }
  };

  const handleSelectOrganisation = () => {
    if (selectedOrg) {
      navigate(`/organisation/${selectedOrg}`); // Navigate to the organisation page
    } else {
      alert('Please select an organisation');
    }
  };

  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-6">Dashboard</h1>

      {organisations.length > 0 ? (
        <div className="mb-6">
          <label className="block mb-2 text-lg">Select an Organisation:</label>
          <select
            className="w-full p-3 border rounded"
            value={selectedOrg}
            onChange={(e) => setSelectedOrg(e.target.value)}
          >
            <option value="">-- Select Organisation --</option>
            {organisations.map((org) => (
              <option key={org.orgId._id} value={org.orgId._id}>
                {org.orgId.name}
              </option>
            ))}
          </select>
          <button
            onClick={handleSelectOrganisation}
            disabled={!selectedOrg}
            className={`mt-4 p-3 rounded w-full ${
              selectedOrg ? 'bg-blue-600 text-white' : 'bg-gray-400 text-gray-800'
            }`}
          >
            Go to Organisation
          </button>
        </div>
      ) : (
        <p className="text-xl font-semibold mb-6">
          You are not part of any organisation yet. Create or search for one below!
        </p>
      )}

      <div>
        <h2 className="text-2xl font-semibold mb-4">Search for Organisations</h2>
        <input
          type="text"
          placeholder="Search for organisations..."
          className="w-full p-3 border rounded mb-4"
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
        />
        <button
          onClick={handleSearch}
          className="bg-blue-600 text-white p-3 rounded w-full mb-4"
        >
          Search
        </button>
        <ul>
          {searchResults.map((org) => (
            <li key={org._id} className="mb-2 p-4 border rounded shadow">
              <div className="flex justify-between">
                <span>{org.name}</span>
                <button
                  onClick={() => handleRequestAccess(org._id)}
                  disabled={org.requested}
                  className={`px-4 py-2 rounded ${
                    org.requested ? 'bg-gray-400' : 'bg-green-600'
                  } text-white`}
                >
                  {org.requested ? 'Request Sent' : 'Request Access'}
                </button>
              </div>
            </li>
          ))}
        </ul>
      </div>

      {requestedOrgs.length > 0 && (
        <div className="mt-6">
          <h2 className="text-xl font-bold mb-4">Requested Organisations</h2>
          <ul>
            {requestedOrgs.map((org) => (
              <li key={org.orgId._id} className="p-4 border rounded mb-2">
                {org.orgId.name} (Pending)
              </li>
            ))}
          </ul>
        </div>
      )}

      <button
        onClick={() => navigate('/create-organisation')}
        className="mt-6 bg-gray-800 text-white p-3 rounded w-full"
      >
        Create Organisation
      </button>
    </div>
  );
};

export default DashboardPage;
